INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(1, 'All Star Superman', 'Grant Morrison', 'The amazing creative team of writer Grant Morrison (BATMAN: ARKHAM ASYLUM) and artist Frank Quitely (WE3) join forces to take Superman back to basics and create a new vision of the World\'s First Super-Hero. This hardcover collection features the first twelve issues of the acclaimed series. Witness the Man of Steel in exciting new adventures featuring Lex Luthor, Jimmy Olsen, Lois Lane, Bizarro, and more.', 5, '9781401232054', 'Paperback,Â 320 pages', '169 x 259 x 13mm', '523g', 'DC Comics', '2011-10-10', , 'Comic', 15, '100.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(2, 'Long Way Down', 'Jason Reynolds', 'After Will\'s brother is shot in a gang crime, he knows the next steps. Don\'t cry. Don\'t snitch. Get revenge. So he gets in the lift with Shawn\'s gun, determined to follow The Rules. Only when the lift door opens, Buck walks in, Will\'s friend who died years ago. And Dani, who was shot years before that. As more people from his past arrive, Will has to ask himself if he really knows what he\'s doing.', 5, '9780571366019', 'Paperback, 208 pages', '168 x 228 x 23mm', '700g', 'FABER & FABER', '2020-11-19', , 'Comic', 12, '63.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(3, 'Lobster Is the Best Medicine', 'Liz Climo', 'Fans have fallen in love with Liz Climo\'s charmingly quirky animal kingdom, which was first featured in The Little World of Liz Climo ,a place where porcupines, anteaters, and grizzly bears all grapple with everyday life with wit and humour. Now Liz returns with a book devoted to friendship. Chapter themes include Old Friends,\" New Friends,\" Unlikely Friends,\" and Friends with Benefits.\" It\'s the perfect gift for a special friend.', 5, '9780762458684', 'Hardback, 128 pages', '132 x 180 x 14mm', '255g', 'Running Press, U.S.', '2015-12-28', , 'Comic', 0, '50.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(4, 'Snug', 'Catana Chetwynd', 'Why bother getting out of bed when you could stay bundled up with that special someone and a book of cozy, cute comics. From the author of the bestselling Little Moments of Love comes Snug, a collection of comics that perfectly captures the honest, playful, and relatable snapshots of romantic life.', 5, '9781524854638', 'Hardback,Â 136 pages', '132 x 183 x 18mm', '313g', 'Andrews McMeels Publishing', '2020-02-06', , 'Comic', 20, '58.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(5, 'Science Comics: Rockets : Defying Gravity', 'Anne Drozd', 'Every volume of Science Comics offers a complete introduction to a particular topic-dinosaurs, coral reefs, the solar system, volcanoes, bats, flying machines, and many more. These gorgeously illustrated graphic novels offer wildly entertaining views of their subjects. Whether you\'re a fourth grader doing a natural science unit at school or a thirty-year-old with a secret passion for airplanes, these books are for you!', 5, '9781626728257', 'Paperback,Â 128 pages', '152.4 x 213.36 x 7.62mm', '249.48g', 'Roaring Brook Press', '2018-06-12', , 'Comic', 0, '54.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(6, 'Before the Coffee Gets Cold', 'Toshikazu Kawaguchi', 'What would you change if you could go back in time?\r\n\r\nIn a small back alley in Tokyo, there is a cafe which has been serving carefully brewed coffee for more than one hundred years. But this coffee shop offers its customers a unique experience: the chance to travel back in time.\r\n\r\nIn Before the Coffee Gets Cold, we meet four visitors, each of whom is hoping to make use of the cafe\'s time-travelling offer, in order to: confront the man who left them, receive a letter from their husband whose memory has been taken by early onset Alzheimer\'s, to see their sister one last time, and to meet the daughter they never got the chance to know.\r\n\r\nBut the journey into the past does not come without risks: customers must sit in a particular seat, they cannot leave the cafe, and finally, they must return to the present before the coffee gets cold', 5, '9781529029581', 'Paperback, 224 pages', '131 x 196 x 16mm', '173g', 'Pan MacMillan', '2019-11-07', , 'Fiction', 50, '40.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(7, 'The Midnight Library', 'Matt Haig', 'Between life and death there is a library.\r\n\r\nWhen Nora Seed finds herself in the Midnight Library, she has a chance to make things right. Up until now, her life has been full of misery and regret. She feels she has let everyone down, including herself. But things are about to change.\r\n\r\nThe books in the Midnight Library enable Nora to live as if she had done things differently. With the help of an old friend, she can now undo every one of her regrets as she tries to work out her perfect life. But things aren\'t always what she imagined they\'d be, and soon her choices place the library and herself in extreme danger.\r\n\r\nBefore time runs out, she must answer the ultimate question: what is the best way to live?', 5, '9781786892706', 'Hardback, 304 pages', '162 x 220 x 29mm', '473g', 'Canongate Books Ltd', '2020-08-13', , 'Fiction', 30, '80.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(8, 'The Boy, The Mole, The Fox and The Horse', 'Charlie Mackesy', 'Discover the very special book that has captured the hearts of millions of readers all over the world.\r\n\r\n\'A wonderful work of art and a wonderful window into the human heart\' Richard Curtis\r\n\r\nA book of hope for uncertain times.\r\n\r\nEnter the world of Charlie\'s four unlikely friends, discover their story and their most important life lessons.\r\n\r\nThe boy, the mole, the fox and the horse have been shared millions of times online - perhaps you\'ve seen them? They\'ve also been recreated by children in schools and hung on hospital walls. They sometimes even appear on lamp posts and on cafe and bookshop windows. Perhaps you saw the boy and mole on the Comic Relief T-shirt, Love Wins?\r\n\r\nHere, you will find them together in this book of Charlie\'s most-loved drawings, adventuring into the Wild and exploring the thoughts and feelings that unite us all.', 5, '9781529105100', 'Hardback, 128 pages', '174 x 222 x 174mm', '540g', 'Ebury Publishing', '2020-10-29', , 'Fiction', 5, '88.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(9, 'Normal People', 'Sally Rooney', 'Connell and Marianne grow up in the same small town in the west of Ireland, but the similarities end there. In school, Connell is popular and well-liked, while Marianne is a loner. But when the two strike up a conversation - awkward but electrifying - something life-changing begins.\r\n\r\nNormal People is a story of mutual fascination, friendship and love. It takes us from that first conversation to the years beyond, in the company of two people who try to stay apart but find they can\'t.\r\n\r\n\'The literary phenomenon of the decade.\' - Guardian', 5, '9780571334650', 'Paperback, 288 pages', '129 x 198 x 17mm', '229g', 'FABER & FABER', '2020-04-22', , 'Fiction', 16, '46.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(10, 'Little Fires Everywhere', 'Celeste Ng', '\'To say I love this book is an understatement...It moved me to tears\' Reese Witherspoon\r\n\r\n\'Beautifully written, completely charming, and extremely wise on the subject of adolescence and influence\' Nick Hornby\r\n\r\nEveryone in Shaker Heights was talking about it that summer: how Isabelle, the last of the Richardson children, had finally gone around the bend and burned the house down.\r\n\r\nIn Shaker Heights, a placid, progressive suburb of Cleveland, everything is meticulously planned - from the layout of the winding roads, to the colours of the houses, to the successful lives its residents will go on to lead. And no one embodies this spirit more than Elena Richardson, whose guiding principle is playing by the rules.\r\n\r\nEnter Mia Warren - an enigmatic artist and single mother- who arrives in this idyllic bubble with her teenage daughter Pearl, and rents a house from the Richardsons. Soon Mia and Pearl become more than just tenants: all four Richardson children are drawn to the mother-daughter pair. But Mia carries with her a mysterious past, and a disregard for the rules that threatens to upend this carefully ordered community.\r\n\r\nWhen old family friends attempt to adopt a Chinese-American baby, a custody battle erupts that dramatically divides the town - and puts Mia and Elena on opposing sides. Suspicious of Mia and her motives, Elena is determined to uncover the secrets in Mia\'s past. But her obsession will come at an unexpected and devastating cost...', 5, '9780349142920', 'Paperback, 400 pages', '131 x 200 x 25mm', '331g', 'Little, Brown Book Group', '2018-05-22', , 'Fiction', 60, '43.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(11, 'The Magic Order Volume 1', 'Mark Millar', 'We live in a world where we\'ve never seen a monster, and The Magic Order is the reason we sleep safely in our beds. Magic meets the Mob in The Magic Order, as five families of magicians - sworn to protect our world for generations - must battle an enemy who\'s picking them off one by one. By day, they live among us as our neighbors, friends and co-workers, but by night they are the sorcerers, magicians and wizards that protect us from the forces of darkness...unless the darkness gets them first.', 5, '9781534308718', 'Paperback,Â 176 pages', '168 x 254 x 25mm', '349g', 'Image Comics', '2019-04-23', , 'Graphic Novel', 46, '77.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(12, 'The Old Guard Book One: Opening Fire', 'Greg Rucka', 'Old soldiers never die...and some of them don\'t even fade away. Cursed with immortality, Andromache of Scythia and her comrades-in-arms ply their trade for those who can find-and afford-their services. But in the 21st century, being immortal is a difficult secret to keep, and when you live long enough, you learn that there are many fates far worse than death.', 5, '9781534302402', 'Paperback, 184 pages', '165 x 251 x 13mm', '331g', 'Image Comics', '2017-09-05', , 'Graphic Novel', 0, '67.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(13, 'Spider-ham Vol. 1: Aporkalypse Now!', 'Zeb Wells', 'Not a dream! Not a hoax! Not an imaginary tail! (Get it?) Peter Porker, the Spectacular Spider-Ham, returns to the pages of his very own series! And as if the swiney super hero\'s recent adventures across the various dimensions of the Spider-Verse weren\'t enough, Spider-Ham now finds himself jumping through time! And accompanied by Spider-Man (the human version), no less! It\'s the human/porcine/arachnid Marvel Team-Up you\'ve been waiting for! But can Ham and Man prevent the horrors of..', 5, '9781846533945', 'Paperback, 116 pages', '170 x 260 x 10mm', '362g', 'Panini Publishing Ltd', '2020-10-02', , 'Graphic Novel', 20, '60.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(14, 'X-men Vol. 1: Dawn Of X', 'Jonathan Hickman', 'DAWN OF X! The X-Men find themselves in a whole new world of possibility... and things have never been better! Follow Cyclops and his hand-picked squad of mutant powerhouses as an island full of unspeakable horrors appears on the horizon! The X-Men have their work cut out for themselves keeping Krakoa, the living island, safe!', 5, '9781846533785', 'Paperback,Â 180 pages', '170 x 260 x 12mm', '483g', 'Panini Publishing Ltd', '2020-08-03', , 'Graphic Novel', 17, '74.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(15, 'Space Bandits', 'Mark Millar', 'Thena Khole and Cody Blue are among the universe\'s most wanted felons. Each the leader of their own criminal ops, they run heists across the galaxies - hopping from ship to ship to fleece everyone inside. But when both women are betrayed by their crews, the bandits only have one thing on their minds: REVENGE.', 5, '9781534315013', 'Paperback,Â 152 pages', '163 x 251 x 13mm', '322g', 'Image Comics', '2020-02-18', , 'Graphic Novel', 32, '66.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(16, 'Qualitative Secondary Research', 'Claire Largan', 'Using secondary data offers unique opportunities and challenges. This practical book will guide you through finding, managing and analysing qualitative secondary data in an error-free way. Perfect for those doing dissertations and research projects, it provides an accessible introduction to the theory of secondary research and sets out the advantages and limitations of using this kind of research.', 5, '9781526410986', 'Paperback, 368 pages', '186 x 232 x 19.3mm', '670g', 'Sage Publications Ltd', '2019-05-30', , 'Reference', 17, '160.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(17, 'Wild Food : A Complete Guide for Foragers', 'Roger Phillips', 'Wild food is all around us, growing in our hedgerows and fields, along river banks and seashores, even on inhospitable moorland. In Roger Phillips and Martyn Rix\'s Wild Food, hundreds of these plants are clearly identified, with colour photography and a detailed description. This definitive guide also gives us fascinating information on how our ancestors would have used the plant as well as including over 100 more modern recipes for delicious food and drinks. From berries, herbs and mushrooms to wild vegetables, salad leaves, seaweed and even bark, this book will inspire you to start cooking with nature\'s free bounty.', 5, '9781447249962', 'Hardback, 240 pages', '197 x 253 x 27mm', '1033g', 'Pan MacMillan', '2016-02-01', , 'Reference', 7, '123.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(18, 'The Culture Map', 'Erin Meyer', 'Whether you work in a home office or abroad, business success in our ever more globalized and virtual world requires the skills to navigate through cultural differences and decode cultures foreign to your own. Renowned expert Erin Meyer is your guide through this subtle, sometimes treacherous terrain where people from starkly different backgrounds are expected to work harmoniously together.When you have Americans who precede anything negative with three nice comments French, Dutch, Israelis, and Germans who get straight to the point ( your presentation was simply awful\") Latin Americans and Asians who are steeped in hierarchy Scandinavians who think the best boss is just one of the crowd,the result can be, well, sometimes interesting, even funny, but often disastrous.Even with English as a global language, it\'s easy to fall into cultural traps that endanger careers and sink deals when, say, a Brazilian manager tries to fathom how his Chinese suppliers really get things done, or an American team leader tries to get a handle on the intra-team dynamics between his Russian and Indian team members.In The Culture Map , Erin Meyer provides a field-tested model for decoding how cultural differences impact international business. She combines a smart analytical framework with practical, actionable advice for succeeding in a global world.', 5, '9781610392761', 'Paperback, 288 pages', '136 x 210 x 22mm', '241g', 'INGRAM PUBLISHER SERVICES US', '2017-09-22', , 'Reference', 70, '58.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(19, 'Underground Cities', 'Mark Ovenden', 'With over 60 per cent of the world\'s population living in cities, the networks beneath our feet - which keep the cities above moving - are more important than ever before. Yet we never truly see how these amazing feats of engineering work.\r\n\r\nJust how deep do the tunnels go? Where do the sewers, bunkers and postal trains run? And, how many tunnels are there under our streets? Each featured city presents a \'skyline of the underground\' through specially commissioned cut-away illustrations and unique cartography.\r\n\r\nDrawing on geography, cartography and historical oddities, Mark Ovenden explores what our cities look like from the bottom up.', 5, '9781781318935', 'Hardback, 224 pages', '235 x 290 x 27.94mm', '1451.5g', 'AURUM PRESS', '2020-09-22', , 'Reference', 23, '134.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(20, 'Stuff You Should Know', 'Josh Clark', 'From the duo behind the massively successful and award-winning podcast Stuff You Should Know comes an unexpected look at things you thought you knew. Josh Clark and Chuck Bryant started the podcast Stuff You Should Know back in 2008 because they were curious--curious about the world around them, curious about what they might have missed in their formal educations, and curious to dig deeper on stuff they thought they understood. As it turns out, they aren\'t the only curious ones. They\'ve since amassed a rabid fan base, making Stuff You Should Know one of the most popular podcasts in the world. Armed with their inquisitive natures and a passion for sharing, they uncover the weird, fascinating, delightful, or unexpected elements of a wide variety of topics. The pair have now taken their near-boundless whys and hows from your earbuds to the pages of a book for the first time--featuring a completely new array of subjects that they\'ve long wondered about and wanted to explore. Each chapter is further embellished with snappy visual material to allow for rabbit-hole tangents and digressions--including charts, illustrations, sidebars, and footnotes. Follow along as the two dig into the underlying stories of everything from the origin of Murphy beds, to the history of facial hair, to the psychology of being lost.', 5, '9781250268501', 'Hardback, 304 pages', '193 x 234 x 25mm', '680g', 'Flatiron Books', '2020-11-24', , 'Reference', 26, '90.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(21, 'Astrophysics for People in a Hurry', 'Neil Degrasse Tyson', 'There\'s no better guide through mind-expanding questions such as what the nature of space and time is, how we fit within the universe, and how the universe fits within us than Neil deGrasse Tyson.\r\n\r\nBut today, few of us have time to contemplate the cosmos. So Tyson brings the universe down to Earth succinctly and clearly, with sparkling wit, in digestible chapters consumable any time and anywhere in the busy day. Astrophysics for People in a Hurry reveals just what you need to be fluent and ready for the next cosmic headlines: from the Big Bang to black holes, from quarks to quantum mechanics and from the search for planets to the search for life in the universe.', 5, '9780393609394', 'Hardback, 224 pages', '122 x 193 x 23mm', '255g', 'WW Norton & Co', '2018-05-15', , 'Technology', 0, '65.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(22, 'To Speak For The Trees', 'Diana Beresford Kroeger', 'Canadian botanist, biochemist and visionary Diana Beresford-Kroeger\'s startling insights into the hidden life of trees have already sparked a quiet revolution in how we understand our relationship to forests. Now, in a captivating account of how her life led her to these illuminating and crucial ideas, she shows us how forests can not only heal us but save the planet. When Diana Beresford-Kroeger--whose father was a member of the Anglo-Irish aristocracy and whose mother was an O\'Donoghue, one of the stronghold families who carried on the ancient Celtic traditions--was orphaned as a child, she could have been sent to the Magdalene Laundries. Instead, the O\'Donoghue elders, most of them scholars and freehold farmers in the Lisheens valley in County Cork, took her under their wing. Diana became the last ward under the Brehon Law. Over the course of three summers, she was taught the ways of the Celtic triad of mind, body and soul. This included the philosophy of healing, the laws of the trees, Brehon wisdom and the Ogham alphabet, all of it rooted in a vision of nature that saw trees and forests as fundamental to human survival and spirituality. Already a precociously gifted scholar, Diana found that her grounding in the ancient ways led her to fresh scientific concepts. Out of that huge and holistic vision have come the observations that put her at the forefront of her field: the discovery of mother trees at the heart of a forest; the fact that trees are a living library, have a chemical language and communicate in a quantum world; the major idea that trees heal living creatures through the aerosols they release and that they carry a great wealth of natural antibiotics and other healing substances; and, perhaps most significantly, that planting trees can actively regulate the atmosphere and the oceans, and even stabilize our climate.', 5, '9780735275072', 'Hardback,Â 272 pages', '153 x 216 x 27.94mm', '430g', 'Prentice Hall Press', '2019-09-26', , 'Technology', 33, '90.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(23, 'Numbers Don\'t Lie', 'Vaclav Smil', 'Is flying dangerous? How much do the world\'s cows weigh? And what makes people happy?\r\n\r\nFrom earth\'s nations and inhabitants, through the fuels and foods that energize them, to the transportation and inventions of our modern world - and how all of this affects the planet itself - in Numbers Don\'t Lie, Professor Vaclav Smil takes us on a fact-finding adventure, using surprising statistics and illuminating graphs to challenge lazy thinking.\r\n\r\nPacked with \'Well-I-never-knew-that\' information and with fascinating and unusual examples throughout, we find out how many people it took to build the Great Pyramid, that vaccination yields the best return on investment, and why electric cars aren\'t as great as we think (yet). There\'s a wonderful mix of science, history and wit, all in bite-sized chapters on a broad range of topics.\r\n\r\nUrgent and essential, Numbers Don\'t Lie inspires readers to interrogate what they take to be true in these significant times. Smil is on a mission to make facts matter, because after all, numbers may not lie, but which truth do they convey?', 5, '9780241454411', 'Hardback,Â 384 pages', '144 x 222 x 35mm', '498g', 'Penguin Books Ltd', '2020-10-01', , 'Technology', 0, '88.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(24, 'Tiny House Design and Construction Guide', 'Dan Louche', 'Take the first step to achieving your dream of building and living in your very own tiny house! The Tiny House Design & Construction Guide is your road map to the entire build process. This guide will help you to understand each step that needs to be taken and, more importantly, give you the confidence to start building your own tiny house.', 5, '9780997288704', 'Paperback,Â 180 pages', '178 x 254 x 12.45mm', '435.45g', 'Tilt Development', '2017-08-16', , 'Technology', 12, '96.00');
INSERT INTO `book` (`BookID`, `Title`, `Author`, `Description`, `Rating`, `ISBN13`, `Format`, `Dimensions`, `Weight`, `Publisher`, `PublicationDate`, `Image`, `Category`, `StockQuantity`, `SalePrice`) VALUES
(25, 'Off Grid Solar Power Simplified', 'Nick Seghers', 'Energy units you didn\'t even know existed Formulas you can\'t live without when building a solar system A comprehensive list of tools that you absolutely need How to choose wire diameters the right way Step by step guide on sizing your off-grid solar system without painful mistakes Why not every wire is suited for solar energy installations The best way to protect your installation from catching fire Discover different batteries; maintenance, price, increase lifespan, configurations, ... Discover different solar panels; tilt, cleaning, optimizing solar input, ... What device is at the heart of any solar power system? Inverters; different types, different sine waves, efficiency, power ratings, ... Discover the best way to monitor the state of charge of your batteries The safest way to charge your solar battery from your car alternator. A step by step guide on how to build your system.', 5, '9789464071009', 'Paperback, 292 pages', '152 x 229 x 15mm', '395g', 'Nick Seghers', '2020-02-01', , 'Technology', 20, '68.00');

